// 상위 컴포넌트: components/Network/NetworkBoard

import React, { Component } from "react";

import { BasicCard, NoPhotoCard, FakeCard } from "./Cards";
import './NetworkPost.css';

class NetworkPost extends Component {

    _renderCard() {
        return (
            <BasicCard
                id = {this.props.id}
                title = {this.props.title}
                author = {this.props.author}
                created = {this.props.created}
                description = {this.props.description}
                fileList = {this.props.filenum}
            />
        )
    }

    render() {

        return (
            <div className="PostCard">
                {
                    this.props.isFake ?
                    <FakeCard/> :
                    this._renderCard()
                }
            </div>
        )
    }
}

export default NetworkPost
